@Henrique Carvalho, mais respeito. Não sou sua mãe nem sua família pra o sr. tratar com essa intimidade.

Em segundo lugar, sr. Henrique: a partir do momento que você fala de agravantes, já entra um caráter subjetivo. 

Se existe essa distorção da lei que o sr. está falando (e ela existe), isso é resultado de um país colonialista, que historicamente vê o negro e pobre como inferior ao rico e branco. Não é tentando dar um verniz "objetivo" ao Direito que vai resolver essa desigualdade histórica que o sr. consegue perceber.

